import styled from "styled-components"

const Footer = styled.div`
    margin-top:100px;
    width:100%;
    display:flex;
    height:270px;
    color:white;
    background-color:#214142;
    justify-content:center;
    align-items:center;
    text-align:center;
    .logo{
        margin:70px 0 10px 0;
    }
    .description{
        font-size:0.5em;
    }
`
export default Footer
